    [],nt"num_tags": 0,nt"name": "enviroatlas-des-moines-ia-tree-cover-configuration-and-connectivity-water-background",nt"isopen":
    false,nt"url": null,nt"notes": "This EnviroAtlas dataset categorizes forest
    land cover into structural elements (e.g. core, edge, connector, etc.). In this
    community, Forest is defined as Trees & Forest (Trees & Forest - 40 = 1; All Else
    = 0). Water was considered background (value 129) during the analysis to create
    this dataset, however it has been converted into value 10 to distinguish it from
    land area background. This dataset was produced by the US EPA to support research
    and online mapping activities related to EnviroAtlas. EnviroAtlas (https://enviroatlas.epa.gov/EnviroAtlas)
    allows the user to interact with a web-based, easy-to-use, mapping application to
    view and analyze multiple ecosystem services for the contiguous United States. The
    dataset is available as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas)
    or as an EnviroAtlas map service. Additional descriptive information about each
    attribute in this dataset can be found in its associated EnviroAtlas Fact Sheet
    (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"owner_org":
